function updateBackgroundImage(base64Image, className) {
    // 모든 스타일 시트를 순회
    for (let i = 0; i < document.styleSheets.length; i++) {
        const sheet = document.styleSheets[i];

        // 각 스타일 시트의 규칙을 순회
        for (let j = 0; j < sheet.cssRules.length; j++) {
            const rule = sheet.cssRules[j];

            // 해당 클래스 이름을 가진 규칙을 찾음
            if (rule.selectorText === className) {
                // background 속성을 base64 이미지로 변경
                rule.style.background = `url(${base64Image}) no-repeat 0 0`;
                if (className === '.pin_schl.starbucks') {
                    rule.style.backgroundSize = '23px 28px';
                } else if (className === '.pin_schl.starbucksR') {
                    rule.style.backgroundSize = '30px 35px';
                } else if (className === '.pin_schl') {
                    rule.style.backgroundSize = '40px 46px';
                }
                return;
            }
        }
    }
}



